R\n================================================== -->\n<div id=\"subheader\">\n\t<div class=\"row\">\n\t\t<div class=\"twelve columns\">\n\t\t\t<p class=\"text-center\">\n\t\t\t\t \"Es kommt nicht blo\u00df auf das \u00c4u\u00dfere einer Frau an. Auch die Dessous sind wichtig!\"<br>\n\t\t\t\t Karl Kraus (Wiener Satiriker 1874-1936)</p>\n\t\t</div>\n\t</div>\n</div>\n<!-- ANIMATED COLUMNS \n================================================== -->\n<div class=\"row\">\n\t<div class=\"twelve columns\">\n\t\t<ul class=\"ca-menu\">\n\t\t\t<li>\n\t\t\t<a href=\"maedels.html\">\n\t\t\t<span class=\"ca-icon\">N</span>\n\t\t\t<div class=\"ca-content\">\n\t\t\t\t<h2 class=\"ca-main\">Wiener M\u00e4dels</h2>\n\t\t\t\t<h3 class=\"ca-sub\">Finden Sie Ihr M\u00e4del</h3>\n\t\t\t</div>\n\t\t\t</a>\n\t\t\t</li>\n\t\t\t<li>\n\t\t\t<a href=\"preise.html\">\n\t\t\t<span class=\"ca-icon\">N</span>\n\t\t\t<div class=\"ca-content\">\n\t\t\t\t<h2 class=\"ca-main\">Preise</h2>\n\t\t\t\t<h3 class=\"ca-sub\">Sie sind ihr Geld wert</h3>\n\t\t\t</div>\n\t\t\t</a>\n\t\t\t</li>\n\t\t\t<li>\n\t\t\t<a href=\"kontakt.html\">\n\t\t\t<span class=\"ca-icon\">N</span>\n\t\t\t<div class=\"ca-content\">\n\t\t\t\t<h2 class=\"ca-main\">Buchen</h2>\n\t\t\t\t<h3 class=\"ca-sub\">Anruf gen\u00fcgt, oder eine Email</h3>\n\t\t\t</div>\n\t\t\t</a>\n\t\t\t</li>\n\t\t\t<li>\n\t\t\t<a href=\"jobs.html\">\n\t\t\t<span class=\"ca-icon\">N</span>\n\t\t\t<div class=\"ca-content\">\n\t\t\t\t<h2 class=\"ca-main\">Bewerben</h2>\n\t\t\t\t<h3 class=\"ca-sub\">Ein 'Wiener M\u00e4del' werden</h3>\n\t\t\t</div>\n\t\t\t</a>\n\t\t\t</li>\n\t\t</ul>\n\t</div>\n</div>\n<!-- CONTENT \n================================================== -->\n<div class=\"row\">\n\t<div class=\"twelve columns\">\n\t\t<div class=\"centersectiontitle\">\n\t\t\t<h4>Willkommen bei der einzigen echten Wiener Escort Agentur</h4>\n\t\t</div>\n\t</div>\n\t<div class=\"four columns\">\n\t\t<h5>Traditionell</h5>\n\t\t<p>\n\t\t\t Seit 1993 ist VIENNA ESCORT der Ma\u00dfstab f\u00fcr perfekte und vor allem echte Wiener Begleitservices. </p>\n\t\t<p>In der Tradition des wohl ber\u00fchmtesten Wiener Escortm\u00e4dels - Josefine Mutzenbacher - bieten wir den besten Service, die sch\u00f6nsten M\u00e4dels und vor allem diskrete und perfekte Abwicklung Ihrer Begleitung f\u00fcr einen sch\u00f6nen und unvergesslichen Wiener Abend ... oder auch l\u00e4nger.</p>\n\t\t<p>Aber, wir ruhen uns auf unseren Lorbeeren nicht aus ...</p>\n\t\t\n\t</div>\n\t<div class=\"four columns\" align=\"center\">\n\t\t\n\t\t<p><img src=\"img/mutzenbacher_rahmen.png\" width=\"264\" height=\"333\" alt=\"\"/>\n\t\t</p>\n\t\t\n\t</div>\n\t<div class=\"four columns\">\n\t\t<h5>Neu</h5>\n\t\t<p>Ab sofort ist VIENNA ESCORT noch besser, sch\u00f6ner, hochwertiger und - vor allem - noch WIENERISCHER.</p>\n\t\t<p>Finden Sie hier die besten und sch\u00f6nsten Escortm\u00e4dels Wiens, nur echte \u00d6sterreicherinnen, die meisten echte Wiener M\u00e4dels. </p>\n\t\t<p>Sie werden Ihnen die anregendsten Seiten Wiens zeigen, egal ob Sie selber Wiener  oder hier auf Besuch sind.</p>\n        <p>\n\t\t\t\t <b>RELAUNCH SPECIAL:</b> F\u00fcr kurze Zeit zur Wiederer\u00f6ffnung von VIENNA ESCORT vergeben wir einen BONUS von 10 EURO f\u00fcr jede Buchung.\n\t\t\t</p>\n\t\t\n\t</div>\n</div>\n<div class=\"hr\">\n</div>\n<!-- TESTIMONIALS \n================================================== -->\n<div class=\"row\">\n\t<div class=\"twelve columns\">\n\t\t<div id=\"testimonials\">\n\t\t  <blockquote>\n\t\t\t\t\n\t        <h5> NEU: Sie k\u00f6nnen bei VIENNA ESCORT auch mit Kreditkarte bezahlen ...</h5>\n\t\t\t  <p><img src=\"img/MasterCard_Logo.png\" width=\"100\" height=\"60\" alt=\"mastercard\" align=\"right\"/> <img src=\"img/Visa_Logo.png\" width=\"100\" height=\"64\" alt=\"visa\"  align=\"right\"/>Buchen Sie Ihr Wiener M\u00e4del wie gewohnt per Telefon oder Mail und vereinbaren Sie die Zahlung per Kreditkarte. Danach geben Sie den vereinbarten Betrag und den Namen des